INSERT INTO `page` (`id`, `user_id`, `title`, `content`, `meta`, `visit`, `create_at`, `update_at`) VALUES
(1, 6, 'درباره آبان', '<p dir="RTL" style="text-align: center;">&nbsp;</p>\n\n<p style="text-align: center;"><img alt="" border="0" height="320" hspace="0" src="data:image/png;base64," style="width: 250px; height: 320px; margin: 0px; border: 0px solid black; float: right;" vspace="0" width="250" /></p>\n\n<p dir="RTL"><strong>از تیرماه 1392 در محیطی زیبا و خاطره انگیز به میزبانی شما مفتخریم. کلینیک دامپزشکی "آبان" با نگاهی متفاوت به مقوله تشخیص و درمان ، همگام با استانداردهای روز جهان،&nbsp; "تشخیص محور" تجهیز شده است ؛ بهترین و پیشرفته ترین دستگاهها و تکنیکهای تشخیصی در خدمت دانش و تجربه متخصصین آبان قرار گرفته اند تا نخستین و مهمترین&nbsp; گام ( تشخیص ) ، با کمترین خطا و بیشترین اطمینان برداشته شود<span dir="LTR">...</span></strong></p>\n\n<p dir="RTL" style="text-align: left;">&nbsp;</p>\n\n<p dir="RTL" style="text-align: left;"><strong>دکتر امین خدابخش سربندی</strong></p>\n\n<p dir="RTL" style="text-align: left;"><strong>مدیر کلینیک دامپزشکی آبان</strong></p>\n\n<p style="text-align: center;">&nbsp;</p>\n\n<p style="text-align: center;">&nbsp;</p>', 'About Aban', 105, '2016-01-20 08:18:58', '2016-07-08 02:41:03');
